oxy_webhelp_navlinks = {"azr_immutable_archival_locations-d22908e5690":{"topics":[{"title":"Blob-level immutability for Azure archival locations","shortdesc":"<p class=\"shortdesc\">Azure archival locations created for Rubrik clusters running Rubrik CDM versions 9.1         or later support blob-level immutability by default.<\/p>","href":"cdm\/azr_blob_immutability.html","attributes":{"data-id":"azr_blob_immutability"},"menu":{"hasChildren":false},"tocID":"azr_blob_immutability-d22908e5701","topics":[]},{"title":"Container-level immutability for Azure archival locations","shortdesc":"<p class=\"shortdesc\">Azure archival locations created for Rubrik clusters running Rubrik CDM versions         earlier than 9.1 leverage the container-level immutability feature of Azure storage         containers and require manual configuration of immutability settings at the time of creating         the archival location in <span class=\"ph\">RSC<\/span>.<\/p>","href":"cdm\/azr_container_immutability.html","attributes":{"data-id":"azr_container_immutability"},"menu":{"hasChildren":false},"tocID":"azr_container_immutability-d22908e5712","topics":[]},{"title":"Container-level immutability for Azure","shortdesc":"<p class=\"shortdesc\">Container-level immutability applies only to archival locations created on Rubrik         clusters running Rubrik CDM versions earlier than 9.1.<\/p>","href":"cdm\/azr_cli.html","attributes":{"data-id":"azr_cli"},"menu":{"hasChildren":false},"tocID":"azr_cli-d22908e5726","topics":[]},{"title":"Immutability lock period for container-level immutability","shortdesc":"<p class=\"shortdesc\">The immutable archival locations on Rubrik clusters running Rubrik CDM versions         earlier than 9.1 rely on the container-level immutability feature of Azure for data         immutability. In this case, an immutability lock period is required for the archival         location, and the period is limited by the retention period of the associated SLA         Domain.<\/p>","href":"cdm\/azr_immutability_lock_periods.html","attributes":{"data-id":"azr_immutability_lock_periods"},"menu":{"hasChildren":false},"tocID":"azr_immutability_lock_periods-d22908e5737","topics":[]},{"title":"Azure archival immutability settings for CDM versions earlier than 9.1","shortdesc":"<p class=\"shortdesc\">When you are creating an Azure archival location for Rubrik clusters running Rubrik         CDM versions earlier than 9.1, you can enable the immutability setting for the archival         location to secure the archived data from any changes for a specified time         period.<\/p>","href":"archival\/arch_azure_immutability_settings.html","attributes":{"data-id":"arch_azure_immutability_settings"},"menu":{"hasChildren":false},"tocID":"arch_azure_immutability_settings-d22908e5748","topics":[]}]}};